odos os modelos apresentados foram obtidos automaticamente. Isto \u00e9, existe um algoritmo que captura os dados do minist\u00e9rio da sa\u00fade e de mobilidade, e realiza as predi\u00e7\u00f5es de forma autom\u00e1tica, sem a interven\u00e7\u00e3o humana. Isto significa que, devido a particularidades dos estados quanto a coleta de informa\u00e7\u00f5es e outros fatores, as predi\u00e7\u00f5es podem n\u00e3o representar corretamente a evolu\u00e7\u00e3o das vari\u00e1veis. Por isso, essas informa\u00e7\u00f5es devem ser analisadas com cuidado e de forma cr\u00edtica."},"id":"1846","type":"Paragraph"},{"attributes":{"text":"Fator de Crescimetno = 51.5009"},"id":"1845","type":"Paragraph"},{"attributes":{"bottom_units":"screen","fill_alpha":0.5,"fill_color":"lightgrey","left_units":"screen","level":"overlay","line_alpha":1.0,"line_color":"black","line_dash":[4,4],"line_width":2,"render_mode":"css","right_units":"screen","top_units":"screen"},"id":"1767","type":"BoxAnnotation"},{"attributes":{"ticks":[1583712000000.0,1584316800000.0,1584921600000.0,1585526400000.0,1586131200000.0,1586736000000.0,1587340800000.0,1587945600000.0,1588550400000.0,1589155200000.0,1589760000000.0,1590364800000.0,1590969600000.0]},"id":"1780","type":"FixedTicker"},{"attributes":{"line_alpha":0.1,"line_color":"#3288bd","line_width":3,"x":{"field":"x"},"y":{"field":"y"}},"id":"1777","type":"Line"},{"attributes":{"line_alpha":0.6,"line_color":"#3288bd","line_width":3,"x":{"field":"x"},"y":{"field":"y"}},"id":"1776","type":"Line"},{"attributes":{"source":{"id":"1775"}},"id":"1779","type":"CDSView"},{"attributes":{"source":{"id":"1782"}},"id":"1786","type":"CDSView"},{"attributes":{"data":{"x":{"__ndarray__":"AACAdckLd0IAAEDbGwx3QgAAAEFuDHdCAADApsAMd0IAAIAMEw13QgAAQHJlDXdCAAAA2LcNd0IAAMA9Cg53QgAAgKNcDndCAABACa8Od0IAAABvAQ93QgAAwNRTD3dCAACAOqYPd0IAAECg+A93QgAAAAZLEHdCAADAa50Qd0IAAIDR7xB3QgAAQDdCEXdCAAAAnZQRd0IAAMAC5xF3QgAAgGg5EndCAABAzosSd0IAAAA03hJ3QgAAwJkwE3dCAACA/4ITd0IAAEBl1RN3QgAAAMsnFHdCAADA
